INSERT INTO `tbl_information` (`info_id`, `info_title`, `info_text`, `info_image`, `info_status`) VALUES
(30, ' IPASS ONLINE NCLEX REVIEW PROGRAM', 'IPASS Processing continuously accepting reviewees! You may enroll in our online NCLEX Review program for NCLEX-USA, NCLEX-Australia, and NCLEX-Canda at any time.\n\nOnline Review Info:\n\nReview Package: Php 20,000\n3 months review program\n1 year unlimited\nMode of Payment: At least 50% of the total review price (upon enrollment)\nYou can enroll at any time. Can get the 3 months UWORLD subscription at a discounted price', '175457-Banner.jpg', 1),
(31, '   OUR COMPANY', 'IPASS Business Processing Services Incorporated is a processing agency that provides assistance to medical professionals who want to experience a hassle-free licensure exam application for the USA and the Middle East.\n\nIts goal is to provide a stress- free processing of the application, credentialing, booking and scheduling of examination, eligibility number issuance, and criminal background check.\n\nSpecifically, the applications that the company is processing are for:  NCLEX, DOH- Abu Dhabi Licensure Exam Application, DHA- Dubai Licensure Exam Application, QCHP- Qatar Examination Scheduling and Qatar Dataflow Processing, OMSB- Oman Licensure Exam Application and Oman Dataflow Processing, SCFHS- Saudi Licensure Exam Application and Saudi Dataflow Processing, Dataflow Transfer Processing assistance, DOH and DHA Exam Exemption Processing,  US License Endorsement, US License Renewal, Score, Transfer Application, VisaScreening, Assistance on CGFNS Qualifying Exam Application, Pass Letter Requisition for the State of New York.\n\nIPASS Processing was founded in May 2016 at Davao City. In April 2019 the company branched out in Manila and February 2020 in Cebu due to the market demand. The huge growth of the company was brought about the constant need for medical professionals abroad. The company is proud of its dedicated processing professionals who enjoy their work in helping the clients achieve their goals. It is a client-centered business service and it focuses not only on document processing but also provides a holistic client approach.\n\nIPASS Processing serves healthcare providers even outside the Philippines. Currently, it has clients located in Abu Dhabi, Dubai, Saudi Arabia, Oman, Qatar, Kuwait, Thailand, Singapore, USA, Malaysia, Bahrain, New Zealand, United Kingdom,  Italy, Nigeria, Japan, Australia, Suriname, Maldives, and all over the Philippines. It serves not only the Filipinos but also to foreign nationalities like Saudi National, Nigerian, Indian, Singaporean, German, Irish, Pakistan, and many more. Through the years IPASS Processing was able to assist thousands of medical professionals.\n\nIPASS Processing continually seeks for growth and development. With its good reputation, IPASS Processing has created partnerships with established companies that created a mutually beneficial outcome for both parties.\n\nWith the managementâ€™s visionary leadership, the company is committed to constantly improve and grow in order to keep up with the demands of the clients and to provide exceptional service.', '', 0),
(32, 'NEW POLICY RELEASED BY CTS', 'New policy was released by Continental Testing Inc or CTS effective July 2020, if your Credential Evaluation Service was issued more than 3 years ago, we cannot undergo a re-evaluation process due to the said policy. If you havenâ€™t taken the exam and choose to continue with your reapplication with the ILLINOIS board of nursing before your CES report expiration date, you will need to do the following: 1. resubmission of application 2. exam registration. Please take note that we recommend and encouraged you to take the exam within the validity of your CES report. \nHowever, if you fail to proceed within the validity date of your CES report and you wish to continue with the ILLINOIS STATE board despite the expired CES report, we can do the following: 1. choose a refresher course and 2. submit to the Department proof of completion to be accomplished in the USA, 3. resubmission of the application, submit a new CES report, 4. submit new Fingerprinting or either you can apply to another state board of your choice.\nThis new state board policy is beyond IPASS processing control. Rest assured that you will be informed and be guided on this process. \n', '', 1);
